import React from 'react'
import './register.css';

const register = () => {
    return (
        <>
            <div className="container">
                <form action="" method="post">
                    <input type="text" name="username" id="username" />
                    <input type="password" name="password" id="password" />
                </form>
            </div>
        </>
    )
}

export default register
